import "../App.css";
//import Article from "./Article";

const Articles = () => {
  async function getArticles() {
    try {
      const url = "http://localhost:5000/articles";
      const data = await (await fetch(url)).json();
      return data;
    } catch (err) {
      console.error(err);
    }
  }
  return <h1>{JSON.stringify(getArticles())}</h1>;
};

export default Articles;
